nd gcy-27 promoter, respectively. ASI is ablated in this strain. Increased dauer formation. Expression of dsRed in coelomocytes. Reference: Beverly M, Anbil S, Sengupta P. J Neurosci. 2011 Aug 10;31(32):11718-27.'),(283,0,277,'','',1,'osm-6::GC3, osm-6::NLS-mCherry-NLS, X-Ray integration of AZ-240, backcrossed 5 x in N2 background. \r\nVIABILITY/Fertility: Compared to N2 strain they have only 50.4%(+-8.4 % Stdev) offspring.  '),(284,1,278,'','CB4856',1,'Hawaiian strain\r\nIsolated from a pineapple field in Hawaii in 1972 by L. Hollen. Wild type. Low copy Tc1; pattern IX. C. elegans wild isolate. CB subclone of HA-8 (Tc1 pattern IX). See also WBPaper00005369. [NOTE (4-2014): Users reported abnormalities in CB4856 in late 2013 and early 2014. The current working stock at the CGC was thawed in 2-2014 from stock frozen in 1995.]'),(285,0,279,'Christian','',0,'injected to pha-1;lite-1'),(286,0,280,'','',1,'osm-6::GC3, osm-6::ceNLS-mCherry-2xSV40NLS, 10 x backcrossed into N2 X-Ray integration of AZ-240\r\n\r\nFertility: Compared to N2 strain they have only 44%(+-17% Stdev) offspring.  Loss of fertility probably occurs at the later stages of life since a comparison at shorter time span 1-3 days fails to manifest in differences.\r\n\r\nObservation: Larval development appears slightly delayed.'),(287,0,281,'Rotem and Eyal','',1,'We took Shachar I. strain that had str-2::gc3;str-2::DsRed and crossed it with LAWA (Lite-1, gpa-6::gc3) strain.\r\n\r\nWe call it Daisey.\r\n'),(288,0,282,'Rotem and Eyal','',1,'tax-6 (P675) mutant crossed with our  lite-1 pha-1 gpa-6::gcamp-3 and pha-1 rescue strain (AKA LAWA).\r\n'),(289,0,283,'Tal','',1,'Crossing between CB4856 wildtype line and AZ-277 (osm-6::GC3,osm-6::NLS-mCherry)\r\nbackcrossed into CB4856 10 times'),(290,0,284,'Lihi','',1,'cross of hpl-2 mutant (AZ129) with TJ356'),(291,1,285,'','YM194',1,'argonaute mutant'),(292,1,286,'','YM191',1,'multiple argonaute mutant:\r\nsago-2(tm894) ppw-1(tm914) ppw-2(tm1120) wago-2(tm2686) wago-1(tm1414) I; wago-11(tm1127) wago-5(tm1113) wago-4(tm1019) II; hrde-1(tm1200) sago-1(tm1195) III; wago-10(tm1186) V; nrde-3(tm1116) X. RNAi resistant.\r\nTemperature sensitive. Maintain at 15 C. Reference: Gu, et al. 2009 Mol Cell 36:234-44. '),(293,1,287,'','YY186',1,'nrde-2 argonaute mutant'),(294,1,288,'','WM49',1,'rde-4 argonaute mutant'),(295,0,289,'','',1,'TJ356 crossed with him-5 mutant for more males for crossings'),(296,3,290,'','INV60005',1,'lite-1 (ce314) somEx[ptph-1::Chr2-mCherry punc-122::GFP]\r\n\r\nReceived from the Biron Lab; Sister clone of INV60006 from same injection with similar expression and transmission. Ref: Iwanir et al., 2016.\r\n'),(297,3,291,'','INV60006',1,'lite-1 (ce314) somEx[ptph-1::Chr2-mCherry punc-122::GFP]\r\n\r\nReceived from the Biron Lab; Sister clone of INV60005 from same injection with similar expression and transmission. Ref: Iwanir et al., 2016.\r\n'),(298,3,292,'','INV60011',1,'tph-1(mg280) lite-1 (ce314) somEx[ptph-1::Chr2-mCherry punc-122::GFP]\r\n\r\nReceived from the Biron Lab. \r\n\r\nCross of INV60006 and INV90003 (lite-1*MT15434)\r\n'),(299,3,293,'','INV60012',1,'mod-5(n3314) lite-1 (ce314) somEx[ptph-1::Chr2-mCherry punc-122::GFP]\r\n\r\nReceived from the Biron Lab. \r\n\r\nCross of INV60006 and INV90004 [lite-1*INV80003 (MT9772 6xbackcross)]\r\n'),(300,3,294,'','INV60014',1,'lite-1 (ce314) somEx[psrh-142::Chr2-mCherry punc-122::GFP]\r\n\r\nReceived from the Biron Lab. No effect on locomotion upon activation observed by Shachar'),(301,3,295,'','INV60015',1,'lite-1 (ce314) somEx[pstph-1::Chr2-mCherry punc-122::GFP]\r\n\r\nReceived from the Biron Lab. Poor effect on locomotion upon activation observed by Shachar\r\nShort (158bp) tph-1 promoter for NSM (and HSN) specific expression - see Sze, 2002.'),(302,3,296,'','INV33009',1,'somEx[ptph-1::TeTx-mCherry punc122::GFP].\r\n\r\nReceived from the Biron Lab. Ref: Iwanir et al., 2016'),(303,3,297,'','INV30008',1,'somEx[pceh-2::TeTx-mCherry punc122::GFP]\r\n\r\nReceived from the Biron Lab. Ref: Iwanir et al., 2016'),(304,3,298,'','INV30010',1,'somEx[psrh-142::TeTx-mCherry punc122::GFP].\r\n\r\nReceived from the Biron Lab. Ref: Iwanir et al., 2016'),(305,3,299,'','INV20007',1,'somEx[Psrh-142:: mcherry::SL2::GFP punc122::RFP]\r\n\r\nN2 (No lite-1) background.\r\n\r\nReceived from the Biron Lab. Strong expression. Never used experimentally.'),(306,3,300,'','LX1932',1,'HSN::chR2 vmGCaMP LX1932 (wzIs30) IV; (vsIs164) X, lite-1(ce314) X lin-15(n765ts) X\r\n\r\nChr2-YFP in HSN. GCaMP5/mCherry in vulval muscles.\r\n\r\nIntegrated line.\r\n\r\nReceived from the Biron Lab upon permission from the generators Collins Lab'),(307,3,301,'','LX2004',1,'vsls183 ; lite-1 LX2004 vsIs183 X; lite-1(ce314) X lin-15(n765ts) X\r\n\r\nIntegrated line (on Chr. X).\r\n\r\nReceived from the Biron Lab upon permission from the generators Collins Lab.\r\n\r\nExpression in HSN + multiple head neurons'),(308,1,302,'','DA2250',1,'mgl-2(tm355); mgl-1(tm1811) X'),(309,1,303,'','MT13293',1,'met-2 (n4256) III'),(310,1,304,'','MT16973',0,'met-1 mutant'),(311,1,305,'','VC936',1,'jmjd-3.1 mutant'),(312,1,306,'','RB1304',0,'wdr-5.1 (ok1417) III'),(313,1,307,'','MT13971',0,'hpl-1 (n4317) X'),(314,0,308,'Yifat','',1,'cross of TJ356 with INV33009 (David Biron\'s lab; AZ296)'),(315,0,309,'Yifat','',1,'cross of TJ356 with tph-1::ChR2- INV60006 (David Biron lab; AZ291)'),(316,0,310,'Yifat','',1,'cross of TJ356 and stph-1::ChR2 - INV60015 (David Biron lab; AZ295) expresses ChR2 in NSM'),(317,0,311,'Yifat','',1,'Cross of TJ356 and srh-142::ChR2 - INV60014 (David Biron lab; AZ294) expresses ChR2 in ADF'),(318,1,312,'','MT17463',1,'set-25 is a methyl-transfaerase to H3K9Me3'),(319,0,313,'Yifat','',1,'made by a cross of TJ356 with AZ312 (set-25 mutant)'),(320,0,314,'Yifat','',1,'made by crossing of TJ356 with AZ302 (mgl-1, mgl-2 mutant)'),(321,1,315,'Andrew Leifert lab','AML32',1,'wtfIs5 [rab-3p::NLS::GCaMP6s + rab-3p::NLS::tagRFP]. Integrated calcium indicator GCaMP6s and calcium-insensitive fluorescent protein RFP in the nuclei of all neurons. Derived from AML14 by integration of wtfEx4. Reference: Nguyen JP, et al. Proceedings of The National Academy of Sciences. 2015 In Press.'),(322,0,316,'Lihi','',1,'made by a cross of TJ356 and met-1 mutant (AZ304) '),(323,0,317,'Yifat','',1,'Made by a cross of TJ356 and mod-1 mutant (AZ224)'),(324,0,318,'Lihi','',1,'made by a cross of TJ356 met-2 mutant (AZ303)'),(325,1,319,'Henrik Bringmann','HBR191',1,'goeIs5 [nmr-1p::SL1::GCaMP3.35::SL2::unc-54 3\'UTR + unc-119(+)]. Reporter allows visualization of several command interneurons. Reference: Schwarz J & Bringmann H. PLoS One. 2013 Sep 20;8(9):e75853.'),(326,1,320,'Chris Rongo','',1,'nuIs25 [glr-1p::glr-1::GFP + lin-15(+)]. Reference: Rango C, et al. Cell. 1998 Sep 18;94(6):751-9.'),(327,1,321,'Zhaoyu Li','TQ3032',1,'xuEx1040 [nmr-1p::G-CaMP3.0 + nmr-1p::DsRed]. Pick fluorescent animals to maintain. Reference: Piggott BJ, et al. Cell. 2011 Nov 11;147(4):922-33.'),(328,1,322,'David Madsen','VM487',1,'nmr-1(ak4) II. Fewer spontaneous reversals. Required for NMDA gated currents.'),(329,0,323,'Christian','',1,'osm-6::GC3, osm-6::ceNLS-mCherry-2xSV40NLS, nmr-1p::SL1::GCaMP3.35::SL2::unc-54 3\'UTR + unc-119(+), made by crossing AZ-280 x AZ-319\r\n'),(330,0,324,'Christian','',1,'osm-6::GC3, osm-6::ceNLS-mCherry-2xSV40NLS,rab-3p::NLS::GCaMP6s + rab-3p::NLS::tagRFP, made by crossing AZ-280 and AZ-315. There are no homozygous animals. Double positive animals are most likely heterozygous. Pick double positive animals to maintain. Use RFP filter to pick, double positive animals will have tagRFP nucleus in orange and some nuclei (the amphid neurons) in red. \r\n'),(331,0,325,'Christian','',1,'osm-6::GC3, osm-6::ceNLS-mCherry-2xSV40NLS (AZ-280) crossed with unc-31 (AZ-179). Worms are supposedly homozygous. They show the unc-31 phenotype. Until 08/08/17 the worms are not yet genotyped by PCR. \r\n\r\nIN CASE OF EXPERIMENTS, PLEASE GENOTYPE THE WORMS!'),(332,0,326,'Rotem & Eyal','',1,'Cross of the daisy strain (str-2::gc3, str-2::dsRed), with Shachar\'s AIY strain (mod-1::nls::mCherry, mod-1::gc3).\r\n'),(333,0,327,'Shachar','',0,'Cross of AZ247 (CX4; odr-7, AWA defect) x AZ115 (PY7502; ceh-36p::caspase + srtx-1p::GFP + unc122p::mCherry, AWC ablated).'),(334,0,328,'Lihi','',1,'a cross between TJ356 and RB1304 (wdr-5.1 mutant)\r\nverified by PCR'),(335,1,329,'','FX01200',1,'hrde-1 mutant'),(336,1,330,'','FX01116',1,'nrde-3 mutant'),(337,0,331,'RE','',0,'Triple strain.'),(338,3,332,'Yoshihige Kimmura','YT2022',0,'YT2022: tzls3[CRE-gfp lin15(+0)]III;lin-15(n765ts) X.  obtained from Yoshishige Kimmura, \r\n\r\n----------------------------------------------------------------------------------------------------------\r\nIF USED EXPERIMENTALLY CITATION IS OBLIGATORY\r\n----------------------------------------------------------------------------------------------------------'),(339,3,333,'','CX16561 (AWA GC only)',1,'Originally:\r\n\r\nkyEx5128[gcy28d::GCaMP D381Y coel::dsRed] kyEx5662[odr-7p::Chrimson::SL2::mCherry 5ng/ul,elt-2::mCherry 2 ng/ul, pSM 93 ng/ul]\r\n\r\nHowever, we seperated them, and now we have only:\r\nkyEx5662[odr-7p::Chrimson::SL2::mCherry 5ng/ul,elt-2::mCherry 2 ng/ul, pSM 93 ng/ul]\r\n'),(340,3,334,'','CX16561 (AIA Only)',1,'Originally:\r\n\r\nkyEx5128[gcy28d::GCaMP D381Y coel::dsRed] kyEx5662[odr-7p::Chrimson::SL2::mCherry 5ng/ul,elt-2::mCherry 2 ng/ul, pSM 93 ng/ul]\r\n\r\nHowever, we separated them, and now we have only:\r\nkyEx5128[gcy28d::GCaMP D381Y coel::dsRed]'),(341,3,335,'','CX16573',1,'kyIs587[gpa-6::G-CaMP2.2b 50 ng/ul, coel::dsRed 15ng/ul pSM 35ng/ul. Integrated with UV.\r\nkyEx5662[odr- 7p::Chrimson::SL2::mCherry 5ng/ul, elt-2::mCherry 2 ng/ul, pSM 93 ng/ul]'),(342,1,336,'','TU3311',0,'uIs60[unc-119p::YFP + unc-119p::sid-1]'),(343,3,337,'Bargmann lab','CX15261',0,'CX15261 - kyIs617 [gcy-28d::HisCl1::SL2::GFP (5 ng/l), myo-3::mCherry (5 ng/l)] \r\n\r\nthis strain expresses HisCl1 in AIA neurons (and potentially in bunch of others as well)'),(344,3,338,'Bargmann lab','CX15954',0,'CX15954 kyEx5402 [str-3::HisCl1::SL2::GFP (100 ng/l)]\r\n\r\nthis line expresses HisCl1 in ASI neurons'),(345,0,339,'Noa','TJ;hrde-1',0,'cross of TJ;him-5 with TM1200 (hrde-1 mutant)\r\nmutant in hrde-1 (part of the rnai signaling path; argonaute)\r\nBackcrossing X5'),(346,0,340,'Noa','TJ;nrde-3',0,'cross of TJ;him-5 with TM1116  (nrde-3 mutant)\r\nmutant in nrde-3 (part of the rnai signaling path; argonaute)\r\nBackcrossing X5'),(347,0,341,'Rotem & Eyal','glr2::gcamp3, glr2::nls-mcherry',0,'injection of glr-2::gcamp3 and glr2::nls-mcherry, using 3kb promoter (primers made by Schahar)\r\nHas AVA, AVE, AIB, weak AIA and other neurons.\r\n\r\n'),(348,0,342,'Shachaf','',0,'a cross between TJ356;him-5 and AZ336 (unc-119p::YFP + unc-119p::sid-1)'),(349,0,343,'Shachaf','',0,'a cross between TJ356;him-5 and eri-1 mutant (AZ250)'),(350,3,344,'','',0,'(Noa will fill the details later).'),(351,1,345,'','NL334',0,' '),(352,1,346,'','NL335',0,' '),(353,1,347,'','NL1137',0,' '),(354,1,348,'','NL1146',0,' '),(355,1,349,'','NL2330',0,' '),(356,1,350,'','CX4533',0,' '),(357,1,351,'','CX4534',0,' '),(358,1,352,'','CX4544',0,' '),(359,1,353,'','AU3',0,' '),(360,1,354,'','VC390',0,' '),(361,1,355,'','CX6161',0,' '),(362,1,356,'','DR47',0,' '),(363,1,357,'','VC3024',0,' '),(364,1,358,'','FK311',0,' '),(365,1,359,'','AH159',0,' '),(366,1,360,'','',0,'David freezed'),(367,0,361,'','',0,'Crossed and frozen by David\r\n\r\na cross between TJ356;him-5 and AZ221 (ok512 [AQ866])'),(368,0,362,'David','',0,'Crossed and frozen by David\r\n\r\na cross between TJ356;him-5 and AZ222 (ok3087)\r\n'),(369,0,363,'','',1,'odr-10 mutant crossed with AWC ablation:\r\nCX3410 (AZ144 [odr-10(ky225) X]) and PY7502 (AZ115 [oyIs85 [ceh-36p::TU#813 + ceh-36p::TU#814 + srtx-1p::GFP + unc-122p::DsRed]]). Done by Vladimir.'),(370,0,364,'','',1,'Cross of odr-10 (CX3410) and AZ97 (Combo-5). Made by Vladimir.\r\n\r\nodr-10(ky225) X\r\nstr-2::ChR2-cherry\r\nstr-2::GCaMP3\r\nsrsx-3::GCaMP3\r\nin pha-1;lite-1\r\n'),(371,0,365,'Noa','',0,'a cross between AZ156 and AZ225'),(372,1,366,'','YT17',0,'crh-1 mutant (CREB like)'),(373,1,367,'','VC3149',0,'Creb like mutant');
